import React, { useState, useEffect } from 'react';
import { processInvoice } from '../services/api';
import HistoryPanel from './HistoryPanel';
import './InvoiceProcessor.css';

const InvoiceProcessor = () => {
  const [file, setFile] = useState(null);
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [showHistory, setShowHistory] = useState(false);
  const [selectedHistoryNote, setSelectedHistoryNote] = useState(null);
  
  const [agentMessages, setAgentMessages] = useState([]);
  const [agentProcessing, setAgentProcessing] = useState(false);

  // DEBUG: Monitorar result
  useEffect(() => {
    console.log('=== STATE RESULT ===');
    console.log('Result:', result);
    console.log('=== FIM DEBUG ===');
  }, [result]);

  const handleFileChange = (e) => {
    setFile(e.target.files[0]);
    setError('');
    setResult(null);
    setAgentMessages([]);
  };

  const addAgentMessage = (message) => {
    setAgentMessages(prev => [...prev, {
      id: Date.now() + Math.random().toString(36).substr(2, 9),
      texto: message,
      timestamp: new Date()
    }]);
  };

  // FUN√á√ÉO PARA ENCONTRAR DADOS EM QUALQUER ESTRUTURA
  const findDataInResponse = (response) => {
    console.log('üîç Buscando dados no response...');
    
    // Tentar todas as poss√≠veis localiza√ß√µes
    const possiblePaths = [
      response?.data,
      response?.dadosNota,
      response?.processamento?.dadosNota,
      response?.dados,
      response?.notaFiscal,
      response?.resultado,
      response // o pr√≥prio response pode ser os dados
    ];

    for (let i = 0; i < possiblePaths.length; i++) {
      const data = possiblePaths[i];
      console.log(`üéØ Tentando caminho ${i}:`, data);
      
      if (data && typeof data === 'object') {
        // Verificar se tem estrutura de nota fiscal
        const hasFornecedor = data.fornecedor && typeof data.fornecedor === 'object';
        const hasCliente = data.cliente && typeof data.cliente === 'object';
        const hasValorTotal = data.valorTotal !== undefined;
        
        if (hasFornecedor || hasCliente || hasValorTotal) {
          console.log(`‚úÖ Dados encontrados no caminho ${i}`);
          return data;
        }
      }
    }
    
    console.log('‚ùå Nenhum dado v√°lido encontrado em nenhum caminho');
    return null;
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    
    if (!file) {
      setError('Por favor, selecione um arquivo PDF');
      return;
    }

    setLoading(true);
    setAgentProcessing(true);
    setError('');
    setResult(null);
    setAgentMessages([]);

    try {
      addAgentMessage('üöÄ Iniciando processamento da nota fiscal...');
      
      console.log('üì§ Enviando arquivo para backend...');
      const response = await processInvoice(file);
      
      console.log('=== üéØ RESPONSE COMPLETO DO BACKEND ===');
      console.log('Response:', response);
      console.log('Tipo do response:', typeof response);
      console.log('Keys do response:', response ? Object.keys(response) : []);
      
      // DEBUG DETALHADO: Verificar cada propriedade
      if (response) {
        console.log('üîç Analisando propriedades:');
        console.log('- response.success:', response.success);
        console.log('- response.data:', response.data);
        console.log('- response.dadosNota:', response.dadosNota);
        console.log('- response.processamento:', response.processamento);
        console.log('- response.metadata:', response.metadata);
        console.log('- response.error:', response.error);
        
        if (response.processamento) {
          console.log('üîç Processamento detalhado:');
          console.log('-- mensagens:', response.processamento.mensagens);
          console.log('-- idMovimento:', response.processamento.idMovimento);
          console.log('-- dadosNota:', response.processamento.dadosNota);
        }
      }
      console.log('=== FIM DEBUG RESPONSE ===');

      // Processar mensagens do agente
      if (response.processamento && response.processamento.mensagens) {
        console.log('üì® Mensagens do agente:', response.processamento.mensagens);
        setAgentMessages(response.processamento.mensagens);
      }

      if (response.success) {
        // BUSCAR DADOS EM QUALQUER ESTRUTURA
        const dadosEncontrados = findDataInResponse(response);
        
        console.log('üéØ Dados encontrados:', dadosEncontrados);
        
        if (dadosEncontrados) {
          // CRIAR ESTRUTURA GARANTIDA
          const resultData = {
            success: true,
            data: dadosEncontrados,
            processamento: response.processamento,
            metadata: response.metadata || {
              fileName: file.name,
              processedAt: new Date().toISOString()
            }
          };
          
          console.log('‚úÖ Estrutura final do result:', resultData);
          setResult(resultData);
          addAgentMessage('‚úÖ Processamento conclu√≠do com sucesso!');
        } else {
          // SE N√ÉO ENCONTRAR DADOS, TENTAR USAR O PR√ìPRIO RESPONSE
          console.log('‚ö†Ô∏è Tentando usar o response completo como dados...');
          const resultData = {
            success: true,
            data: response, // Usar o response completo
            processamento: response.processamento,
            metadata: response.metadata
          };
          
          console.log('‚úÖ Estrutura alternativa do result:', resultData);
          setResult(resultData);
          addAgentMessage('‚úÖ Processamento conclu√≠do (estrutura alternativa)!');
        }
      } else {
        setError(response?.error || 'Erro desconhecido no processamento');
        addAgentMessage('‚ùå Erro no processamento');
      }
      
    } catch (err) {
      console.error('üí• Erro no frontend:', err);
      setError('Erro ao processar o arquivo');
      addAgentMessage('‚ùå Erro de comunica√ß√£o com o servidor');
    } finally {
      setLoading(false);
      setAgentProcessing(false);
    }
  };

  // Componente para exibir mensagens do agente
  const AgentMessagesPanel = () => {
    if (agentMessages.length === 0 && !agentProcessing) {
      return null;
    }

    return (
      <div className="agent-messages-panel">
        <h3>ü§ñ Agente Inteligente - Processamento</h3>
        <div className="agent-messages-container">
          {agentMessages.map((message, index) => {
            const uniqueKey = message.id ? `${message.id}_${index}` : `msg_${index}`;
            const messageText = message?.texto || '';
            const isError = messageText.includes('‚ùå') || messageText.toLowerCase().includes('erro');
            const isSuccess = messageText.includes('‚úÖ') || messageText.toLowerCase().includes('sucesso');
            
            return (
              <div 
                key={uniqueKey}
                className={`agent-message ${isError ? 'error' : ''} ${isSuccess ? 'success' : ''}`}
              >
                <span className="agent-message-time">
                  {message.timestamp ? new Date(message.timestamp).toLocaleTimeString() : new Date().toLocaleTimeString()}
                </span>
                <div className="agent-message-text">
                  {messageText.split('\n').map((line, lineIndex) => (
                    <div key={`${uniqueKey}_line_${lineIndex}`}>{line}</div>
                  ))}
                </div>
              </div>
            );
          })}
          
          {agentProcessing && agentMessages.length === 0 && (
            <div className="agent-message" key="processing_initial">
              <span className="agent-message-time">{new Date().toLocaleTimeString()}</span>
              <div className="agent-message-text">‚è≥ Iniciando processamento...</div>
            </div>
          )}
          
          {agentProcessing && (
            <div className="agent-processing-indicator" key="processing_indicator">
              <div className="agent-spinner"></div>
              <span>Processando com Agente Inteligente...</span>
            </div>
          )}
        </div>
      </div>
    );
  };

  // Fun√ß√µes de formata√ß√£o
  const formatCurrency = (value) => {
    if (!value && value !== 0) return 'R$ 0,00';
    return new Intl.NumberFormat('pt-BR', {
      style: 'currency',
      currency: 'BRL'
    }).format(value);
  };

  const formatCNPJ = (cnpj) => {
    if (!cnpj || cnpj === 'N/A' || cnpj === '') return 'N/A';
    const cleaned = cnpj.replace(/\D/g, '');
    if (cleaned.length !== 14) return cnpj;
    return cleaned.replace(/(\d{2})(\d{3})(\d{3})(\d{4})(\d{2})/, '$1.$2.$3/$4-$5');
  };

  const formatCPF = (cpf) => {
    if (!cpf || cpf === 'N/A' || cpf === '') return 'N/A';
    const cleaned = cpf.replace(/\D/g, '');
    if (cleaned.length !== 11) return cpf;
    return cleaned.replace(/(\d{3})(\d{3})(\d{3})(\d{2})/, '$1.$2.$3-$4');
  };

  const formatEndereco = (endereco) => {
    if (!endereco || endereco === 'N/A' || endereco === '') return 'N/A';
    return endereco;
  };

  // FUN√á√ÉO PARA EXTRAIR DADOS DE QUALQUER ESTRUTURA
  const extractData = (data, path) => {
    if (!data) return null;
    
    // Tentar acessar o caminho diretamente
    let value = data;
    const paths = path.split('.');
    
    for (const p of paths) {
      if (value && typeof value === 'object' && p in value) {
        value = value[p];
      } else {
        return null;
      }
    }
    
    return value;
  };

  // RENDERIZA√á√ÉO QUE FUNCIONA COM QUALQUER ESTRUTURA
  const renderData = () => {
    if (!result || !result.data) {
      return <div className="error-message">Nenhum dado dispon√≠vel para exibi√ß√£o</div>;
    }

    console.log('üéØ Renderizando com dados:', result.data);

    // Extrair dados de qualquer estrutura
    const fornecedor = extractData(result.data, 'fornecedor') || 
                      extractData(result.data, 'data.fornecedor') || 
                      extractData(result.data, 'dadosNota.fornecedor');
    
    const cliente = extractData(result.data, 'cliente') || 
                   extractData(result.data, 'data.cliente') || 
                   extractData(result.data, 'dadosNota.cliente') ||
                   extractData(result.data, 'faturado');
    
    const numeroNotaFiscal = extractData(result.data, 'numeroNotaFiscal') || 
                            extractData(result.data, 'data.numeroNotaFiscal') || 
                            extractData(result.data, 'dadosNota.numeroNotaFiscal');
    
    const dataEmissao = extractData(result.data, 'dataEmissao') || 
                       extractData(result.data, 'data.dataEmissao') || 
                       extractData(result.data, 'dadosNota.dataEmissao');
    
    const valorTotal = extractData(result.data, 'valorTotal') || 
                      extractData(result.data, 'data.valorTotal') || 
                      extractData(result.data, 'dadosNota.valorTotal');
    
    const produtos = extractData(result.data, 'produtos') || 
                    extractData(result.data, 'data.produtos') || 
                    extractData(result.data, 'dadosNota.produtos');
    
    const parcelas = extractData(result.data, 'parcelas') || 
                    extractData(result.data, 'data.parcelas') || 
                    extractData(result.data, 'dadosNota.parcelas');
    
    const classificacaoDespesa = extractData(result.data, 'classificacaoDespesa') || 
                                extractData(result.data, 'data.classificacaoDespesa') || 
                                extractData(result.data, 'dadosNota.classificacaoDespesa');

    console.log('üìä Dados extra√≠dos para renderiza√ß√£o:');
    console.log('- Fornecedor:', fornecedor);
    console.log('- Cliente:', cliente);
    console.log('- N√∫mero NF:', numeroNotaFiscal);
    console.log('- Valor Total:', valorTotal);

    return (
      <div className="result-container">
        <h2>üìÑ Dados Extra√≠dos da Nota Fiscal</h2>
        
        {/* DEBUG VISUAL */}
        <div style={{
          background: '#fff3cd', 
          padding: '15px', 
          margin: '10px 0', 
          border: '2px solid #ffc107',
          borderRadius: '8px'
        }}>
          <h4>üîç DEBUG - ESTRUTURA ENCONTRADA</h4>
          <div style={{fontSize: '12px', fontFamily: 'monospace'}}>
            <div><strong>Fornecedor:</strong> {fornecedor ? 'ENCONTRADO' : 'N√ÉO ENCONTRADO'}</div>
            <div><strong>Cliente:</strong> {cliente ? 'ENCONTRADO' : 'N√ÉO ENCONTRADO'}</div>
            <div><strong>N√∫mero NF:</strong> {numeroNotaFiscal || 'N/A'}</div>
            <div><strong>Valor Total:</strong> {valorTotal || 'N/A'}</div>
          </div>
        </div>

        {/* Informa√ß√µes B√°sicas */}
        <div className="summary-section">
          <h3>üìã Informa√ß√µes da Nota</h3>
          <div className="summary-grid">
            <div className="summary-item">
              <span className="summary-label">N√∫mero NF:</span>
              <span className="summary-value">{numeroNotaFiscal || 'N/A'}</span>
            </div>
            <div className="summary-item">
              <span className="summary-label">Data Emiss√£o:</span>
              <span className="summary-value">{dataEmissao || 'N/A'}</span>
            </div>
            <div className="summary-item">
              <span className="summary-label">Valor Total:</span>
              <span className="summary-value">{formatCurrency(valorTotal)}</span>
            </div>
          </div>
        </div>

        {/* Fornecedor */}
        {fornecedor && (
          <div className="supplier-section">
            <h3>üè¢ Fornecedor</h3>
            <div className="supplier-info">
              <p><strong>Raz√£o Social:</strong> <span className="info-value">{fornecedor.razaoSocial || 'N/A'}</span></p>
              <p><strong>CNPJ:</strong> <span className="info-value">{formatCNPJ(fornecedor.cnpj)}</span></p>
            </div>
          </div>
        )}

        {/* Cliente */}
        {cliente && (
          <div className="client-section">
            <h3>üë§ Cliente</h3>
            <div className="client-info">
              <p><strong>Nome:</strong> <span className="info-value">{cliente.nome || cliente.nomeCompleto || 'N/A'}</span></p>
              <p><strong>Documento:</strong> <span className="info-value">
                {cliente.cpf ? formatCPF(cliente.cpf) : 
                 cliente.cnpj ? formatCNPJ(cliente.cnpj) :
                 cliente.documento || 'N/A'}
              </span></p>
            </div>
          </div>
        )}

        {/* JSON Completo para Debug */}
        <details className="json-details">
          <summary>üîß JSON Completo (Debug)</summary>
          <pre className="result-json">
            {JSON.stringify(result.data, null, 2)}
          </pre>
        </details>
      </div>
    );
  };

  const handleShowHistory = () => {
    setShowHistory(true);
  };

  const handleCloseHistory = () => {
    setShowHistory(false);
    setSelectedHistoryNote(null);
  };

  const handleSelectHistoryNote = (noteData) => {
    setSelectedHistoryNote(noteData);
    setShowHistory(false);
    if (noteData && noteData.data) {
      setResult({
        success: true,
        data: noteData.data,
        metadata: {
          fileName: noteData.originalFileName,
          processedAt: noteData.processedAt,
          fromHistory: true
        }
      });
    }
  };

  return (
    <div className="invoice-processor">
      <h1>LSR - NF</h1>
      <p>Fa√ßa upload de uma nota fiscal em PDF para extrair os dados automaticamente</p>
      
      <div className="history-button-container">
        <button 
          type="button"
          onClick={handleShowHistory}
          className="history-button"
        >
          üìã Ver Hist√≥rico
        </button>
      </div>
      
      <form onSubmit={handleSubmit} className="upload-form">
        <div className="file-input-container">
          <input
            type="file"
            accept=".pdf"
            onChange={handleFileChange}
            className="file-input"
            id="pdfFile"
          />
          <label htmlFor="pdfFile" className="file-label">
            {file ? file.name : 'Selecionar PDF'}
          </label>
        </div>
        
        <button 
          type="submit" 
          disabled={loading || !file}
          className="process-button"
        >
          {loading ? 'Processando...' : 'Extrair Dados'}
        </button>
      </form>

      <AgentMessagesPanel />

      {error && (
        <div className="error-message">
          {error}
        </div>
      )}

      {/* Renderiza√ß√£o dos dados */}
      {result && result.success && renderData()}

      <HistoryPanel 
        isOpen={showHistory}
        onClose={handleCloseHistory}
        onSelectNote={handleSelectHistoryNote}
      />
    </div>
  );
};

export default InvoiceProcessor;
